INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (2, 1, 2834, 91002, 8, "ペコリーヌとの出会い", "フリーマーケット会場", "青空の下で謁見", 40, 10118, 20063115, 0, 5118061, 7, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (2, 1, 2835, 91002, 8, "マホとの出会い", "フリーマーケット会場", "未来の騎空団\nマスコット？", 40, 10118, 20063115, 0, 5118062, 7, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (2, 1, 2837, 91002, 8, "アキノとの出会い", "ランドソル市街地", "お嬢さまからの\n緊急依頼", 40, 10118, 20063115, 0, 5118063, 7, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (2, 1, 4108402, 91002, 8, "ジュンとの出会い", "フリーマーケット会場", "黄金色の悩みごと", 40, 10118, 20063115, 0, 5118064, 18, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (2, 1, 4107402, 91002, 8, "カオリとの出会い", "フリーマーケット会場", "白熱！　格闘大会！", 40, 10118, 20063115, 0, 5118065, 18, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (2, 1, 9000227, 91002, 8, "ニノンとの出会い", "オーエド町", "祭り太鼓はオーエドの華", 40, 10118, 20063115, 1, 5118066, 16, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (3, 1, 2101181, 91002, 8, "スズナとの出会い", "フリーマーケット会場", "人気者は遅れて\nやってくる", 40, 10118, 20063115, 0, 5118067, 19, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (3, 1, 4109402, 91002, 8, "ナナカとの出会い", "ランドソル市街地", "巫女・ミーツ・魔法少女", 40, 10118, 20063115, 0, 5118068, 18, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (3, 1, 4305402, 91002, 8, "キャル＆コッコロとの出会い", "フリーマーケット会場", "ネズ耳は二度なくなる", 40, 10118, 20063115, 0, 5118069, 18, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (3, 1, 4101402, 91002, 8, "ユカリとの出会い", "ランドソル市街地", "この出会いにカンパイ！", 40, 10118, 20063115, 0, 5118070, 18, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (3, 1, 4106402, 91002, 8, "アオイとの出会い", "ランドソル市街地", "陰陽アンサンブル", 40, 10118, 20063115, 0, 5118071, 18, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (3, 1, 2836, 91002, 8, "シノブとの出会い", "フリーマーケット会場", "運試し十番勝負！", 40, 10118, 20063115, 1, 5118072, 7, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。");
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (1, 0, 0, 0, 0, "オープニング", 0, "彼女たちの新たな日常", 0, 10118, 20063115, 0, 5118600, 0, 0);
